def canCompleteCircuit(gas, cost):
    if sum(gas) < sum(cost):
        return -1 
    current_gas = 0
    ans = 0 
    for i in range(len(gas)):
        current_gas += gas[i] - cost[i]
        if current_gas < 0 :
            ans = i+1 
            current_gas = 0 
    return ans 

    
    
